import React from 'react';
import PropTypes from 'prop-types';
import { useState } from 'react';

function Testa (props) {
  const { tit, name, mess } = props;
  const [status , setTus] = useState("Status : Start");
  const [tusDone , Done] = useState("start");
  return (
    <div className="taskItem mx-2 my-2 px-2 py-2">
      <p> Title : <a> {tit}</a> </p><br></br>
      <p> Creator : <a>{name} </a></p><br></br>
      <p> <a className={tusDone}>Status :{status} </a></p><br></br>
      <p>
        Desscription:<br /> {mess} 
      </p>
      <button onClick={()=>{setTus("Done"); Done("done")}}>Done</button>
      <button onClick={()=>{setTus("Doning");Done("doning")}}>Doning</button>
    </div>
  )
};
Testa.propTypes = {
}
Testa.defaultProps = {
  tit : "title 1",
  name : "name",
  status : "status 1",
  mess : "messs",
}
export default Testa;
